Interface for the SPI resource for an entire chip. The chip accesses the platform SPI resource one time, but can have multiple clients using the SPI bus on top. When all of the clients are released, the chip will normally try to release itself from the platforms SPI bus. In some cases, this isn't desirable - so even though upper components aren't actively using the SPI bus, they can tell the chip to hold onto it so they can have immediate access when they need.
Any component that aborts a release MUST attempt the release at a later time if they don't acquire and release the SPI bus naturally after the abort.
@author David Moss

SPI Packet/buffer interface for sending data over an SPI bus. This interface provides a split-phase send command which can be used for sending, receiving or both. It is a "send" command because reading from the SPI requires writing bytes. The send call allows NULL parameters for receive or send only operations. This interface is for buffer based transfers where the microcontroller is the master (clocking) device.
Often, an SPI bus must first be acquired using a Resource interface before sending commands with SPIPacket. In the case of multiple devices attached to a single SPI bus, chip select pins are often also used.
@author Philip Levis @author Jonathan Hui @author Joe Polastre Revision: $Revision: 1.7 $

